import Button from "../component/Button";
import Editor from "../component/Editor";
import Header from "../component/Header";

const Home = () => {
    return (
        <div>
            <Header 
                title = {"Home"}
                leftChild={
                    <Button
                        type="positive"
                        text={"긍정 버튼"}
                        onClick={()=>{
                            alert("po button");
                        }}
                    />
                }

                rightChild={
                    <Button
                        type="negative"
                        text={"부정 버튼"}
                        onClick={()=>{
                            alert("ne button");
                        }}
                    />
                }
            />
            <Editor/>
        </div>
    );
        
};

export default Home;
